import React from "react";
import "./style.css";
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import Image from 'react-bootstrap/Image';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faGithub, faLinkedin } from "@fortawesome/free-brands-svg-icons";
import { faEnvelope, faFilePdf} from '@fortawesome/free-solid-svg-icons';


const ContactPage = () => {
    return (
        <Container>
            <Row>
                <Col xs={6} md={4}>
                    <div className="icon">
                    <FontAwesomeIcon icon={faLinkedin} id="linked"  />
                    <FontAwesomeIcon icon={faGithub} id="git" href="https://github.com/elviafranco"/>
                    <FontAwesomeIcon icon={faEnvelope} id="envelope" href="mailto:evfranco@asu.edu" />
                    <FontAwesomeIcon icon={faFilePdf} id="pdf" />
                    </div>
                </Col>
            </Row>

        </Container>
    )
}

export default ContactPage;
